import { Route, Routes } from "react-router-dom";
import Header from "./composants/headers/Header";
import UserProvider from "./contexts/UserContext";
const App = () => {
  return (
    <>
      <UserProvider>
        <Header />
        <Routes>
          <Route path />
        </Routes>
      </UserProvider>
    </>
  );
}

export default App;
